const initialState = {inputValue: 'itclanCoder', list: ['itclanCoder', '川川', '学习Redux'] };


export default (state = initialState, action)=>{
    switch(action.type){
        case 'case1':
            console.log("TEST1信息："+initialState.inputValue)
            return { ...state, inputValue: "啦啦啦" };

    }

}
